script: |
  super -f text -I q3493.spq | sort > q3493.out

inputs:
  - name: q3493.spq
    data: |
      SELECT col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE col1 * + - col0 IS NOT NULL AND col2 + col1 BETWEEN ( - 66 ) AND + col1 - col0;
  - name: tab1

outputs:
  - name: q3493.out
    data: |
